import { Navbar, Nav} from 'react-bootstrap';
import React from 'react';

export function Navsocial(){
    return(<Navbar bg="light" expand="lg">
    <Navbar.Brand href="#home">Social Media</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="mr-auto">
        <Nav.Link href="#facebook"><i className="fab fa-facebook"></i></Nav.Link>
        <Nav.Link href="#twitter"><i className="fab fa-twitter"></i></Nav.Link>
        <Nav.Link href="#instagram"><i className="fab fa-instagram"></i></Nav.Link>
      </Nav>
    </Navbar.Collapse>
  </Navbar>);
}
